import React from 'react';

const NavBar = () => {
    function contactMethods() {
        return (
            <div style={{display: 'flex', justifyContent: 'space-between', backgroundColor: '#005', color: 'white'}}>
                <div>
                    <span>[logo]SALES@RENTAWARE.COM</span>
                    <span>  |  </span>
                    <span>[logo]+65 8936 3356</span>
                </div>

                <div>
                    <span>[logo]My Wishlist</span>
                </div>
            </div>
        )
    }

    function mainNavbar() {
        return (
            <div>

            </div>
        )
    }

    return (
        <div>
           {contactMethods()}
           {mainNavbar()}
        </div>
    )
}

export default NavBar;
